import { createApiCall } from './apiCalls'; // Importa la función para crear instancias de API
import { useSelector } from 'react-redux';
import { selectToken } from '../features/auth/authSlice'; // Selector para obtener el token

const useApiConstructor = (baseURL) => {
  const token = useSelector(selectToken);
  return createApiCall(baseURL, token);
};

export { useApiConstructor };
